import { StyledHomeIcon } from "./styles/HomeIcon.styled";
import wolfIcon from "../assets/avatarIcon.svg";

const HomeIcon = () => {
  return (
    <StyledHomeIcon>
      <img src="wolfIcon" alt="wolf icon" />
    </StyledHomeIcon>
  );
};

export default HomeIcon;
